


CREATE TABLE public.customers (
    customer_name text,
    customer_surname text,
    email text,
    phone character varying(10),
    username text NOT NULL,
    password text,
    verification boolean DEFAULT false,
    id uuid,
    address_id uuid DEFAULT 'b8b3e6ec-fa7c-4717-a40f-33f74186ec71'::uuid NOT NULL
);


ALTER TABLE public.customers OWNER TO postgres;

CREATE TABLE public.delivery_address (
    street_num integer,
    street_name text,
    apt_number character varying(20),
    city text,
    state character varying(2),
    zip_code integer,
    id uuid NOT NULL
);


ALTER TABLE public.delivery_address OWNER TO postgres;



CREATE TABLE public.messages (
    id integer NOT NULL,
    name character varying DEFAULT ''::character varying,
    message character varying NOT NULL
);


ALTER TABLE public.messages OWNER TO postgres;


CREATE SEQUENCE public.messages_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


ALTER TABLE public.messages_id_seq OWNER TO postgres;



ALTER SEQUENCE public.messages_id_seq OWNED BY public.messages.id;




CREATE TABLE public.orders (
    time_ordered timestamp with time zone,
    users text,
    id uuid NOT NULL,
    total numeric
);


ALTER TABLE public.orders OWNER TO postgres;



CREATE TABLE public.products (
    id integer NOT NULL,
    quantity integer,
    name text,
    in_stock boolean,
    price numeric(2,0),
    image text
);


ALTER TABLE public.products OWNER TO postgres;


CREATE TABLE public.products_orders (
    product_id integer NOT NULL,
    order_id uuid NOT NULL,
    product_amount integer NOT NULL
);


ALTER TABLE public.products_orders OWNER TO postgres;


ALTER TABLE ONLY public.messages ALTER COLUMN id SET DEFAULT nextval('public.messages_id_seq'::regclass);



